int recursive(vector<int>& nums, int s, int e, int target){
        if(s > e) 
            return -1;
        
        int mid = s + (e - s) / 2;
        
        if(nums[mid] == target) 
            return mid;
        
        if(target > nums[mid]) 
            return recursive(nums, mid + 1, e, target);
        else
            return recursive(nums, s, mid - 1, target);
    }

